import React from 'react'
import { Container, Row ,Col} from "reactstrap";
// import SymptomChecklist from '../SymptomChecklist/SymptomChecklist'
import CurrentNews from "../../../HomePage/currentnews"
import Cases from "../../../HomePage/Cases"
// import ResidentWarning from '../ResidentWarning/ResidentWarning'
import VisitHistory from '../VisitHistory/VisitHistory'
import { readPatientVisitHistory } from "../../../../actions/patients"
import "./ProfileTable.css"

class ProfileTable extends React.Component {

    constructor(props) {
        super(props)
        this.app = props.app
        this.state = {
            province: this.props.patient.province,
            history: this.props.patient.VisitHistory
        }
    }

    componentWillMount() {
        readPatientVisitHistory(this.app)
    }

    render() {
        const { history} = this.props.history;


        return(
            <div>
                <Container>
                    <div className="outer_box">
                        {/* <div className="profilePic">
                            <img alt=""/>
                        </div> */}
                        <div className="current_news">
                            <Cases p={this.state.province}/>
                        </div>
                        <div className="visit_history">
                            <VisitHistory history={history} app={this.app} visits={this.state.history}/>
                        </div>
                        {/* <div className="province">
                            <ResidentWarning province={this.state.province} percent={infected_lvl}/>
                        </div> */}

                    </div>
                </Container>
                <div>
                <Container>
                    <CurrentNews/>
                </Container>
                </div>
            </div>
        )
    }

}

export default ProfileTable
